import React from 'react';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
const SignUp = () => {
  return (
    <div>

<Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"/>
              </Grid>
    </div>
  )
}

export default SignUp
